import React from "react";

export const Tracking = (props) => {
  return (
    <div id="tracking">
      <div className="container">
        <div className="row">

          <div className="col-xs-12 col-md-6">
            <div className="painPoint-text">
              <div className="row">
                {props.data && props.data.sta
                  ? props.data.sta.map((d, i) => (
                      <div key={`${d.title}-${i}`} className="">
                        <h3>{d.title}</h3>
                        <p>{d.text}</p>
                      </div>
                    ))
                  : "Loading..."}
              </div>
              <div className="col-xs-12 col-md-6">
                {" "}
                <img src="img/app.png" className="img-responsive" alt="" />{" "}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
